package gg.noob.lib.tab.skin;

import lombok.Getter;

// Next Update Structure
// Skin
//  - New Skin
//  - Customizable Skin
//  - Fetcher Mineskin Web, Fetcher MineAPI

@Getter
public enum SkinType {

	DARK_GRAY(new String[] {
			"",
			"" }),
	ONLINE(new String[] {
			"",
			"" }),
	OFFLINE(new String[] {
			"",
			"" }),
	DOLLAR(new String[] {
			"",
			"" }),
	DISCORD(new String[] {
			"",
			"" }),
	TWITTER(new String[] {
			"",
			"" });

	private String[] skinData;

	/**
	 * Constructor to make a static {@link SkinType}
	 * 
	 * @param skinData the value and signature of a skin
	 */
	SkinType(String[] skinData) {
		this.skinData = skinData;
	}

	public String getValue() {
		return skinData[0];
	}

	public String getSignature() {
		return skinData[1];
	}

	public SkinType create(String[] skinData) {
		this.skinData = skinData;

		return this;
	}
}
